import React from 'react';
import CartItem from './CartItem';

class Cart extends React.Component {
    render () {
    const { products } = this.state;
    return (
      <div className="cart">
        {products.map((product) => {
          return (
            <CartItem
              product={product}
              key={product.id}
              onIncreaseQuantity={pro.handleIncreaseQuantity}
              onDecreaseQuantity={pro.handleDecreaseQuantity}
              onDeleteQuantity={this.handleDeleteQuantity}
            />
          )
        })}
      </div>
    );
  }
}

export default Cart;
